import React from 'react';
import './TPPedia.scss';


export default function TPPedia() {
    return (
        <div className="tppedia-container">
            <div className="tppedia-header">
                <h1>Trainings</h1>
                <div className="border-btm"></div>
            </div>
        </div>
    )
}
